import React from "react";
import Nav from "./Nav";
import Link from "next/link";
import styled from "styled-components";

function Header() {
	return (
		<header>
			<div className="bar">
				<Link href="/">
					<h1>Sick fits</h1>
				</Link>
			</div>

			<div className="sub-bar">
				<p>Search</p>
			</div>
			<Nav />
		</header>
	);
}

export default Header;
